import { Box, Button } from "@mui/material";
import React, { useState } from "react";
import { useEffect } from "react";
import RandomQuotes from "../../component/RandomQuotes/index.tsx";

const ReRenderPage = () => {
  const [click, setClick] = useState<number>(0);
    const [quote, setQuote] = useState<string>("Random");
  
    const quotes = [
      "The only limit to our realization of tomorrow is our doubts of today.",
      "The future belongs to those who believe in the beauty of their dreams.",
      "In the end, we will remember not the words of our enemies, but the silence of our friends.",
    ];
    useEffect(() => {
      const index = Math.floor(Math.random() * 3);
      setQuote(quotes[index]);
    }, []);
  return (
    <>
      <Box>
        <h1>ReRenderPage</h1>
        <p>This is the ReRenderPage component.</p>
        <RandomQuotes setClick={setClick} quote={quote}/>
        <Button
          variant="contained"
          onClick={() => {
            setClick((prev) => (prev += 1));
          }}
        >
          {"Click me not to render quote"}
        </Button>
        <Box sx={{ padding: "1rem", backgroundColor: "greenyellow" }}>
          {click}
        </Box>
      </Box>
    </>
  );
};
export default ReRenderPage;
